    "headersStr": "Built-In Signals",
    "content": "# Signal\n\nA signal is an easy way to emit events and listen for them. You can use signals in your game for example to tell listeners, that something exploded.\n\nA while back I came across this neat article about a good C++11 signal system: Performance of a C++11 Signal System typed-ecstasy uses typed-signals, a TypeScript port of said article.\n\n\n# Built-In Signals\n\ntyped-ecstasy uses signals in the EntityManager, specifically:\n\n * onAdd\n * onRemove\n * onAddForFamily\n * onRemoveForFamily\n\nThese will be emitted when an entity gets added/removed to/from the engine or a specific family.",
    "normalizedContent": "# signal\n\na signal is an easy way to emit events and listen for them. you can use signals in your game for example to tell listeners, that something exploded.\n\na while back i came across this neat article about a good c++11 signal system: performance of a c++11 signal system typed-ecstasy uses typed-signals, a typescript port of said article.\n\n\n# built-in signals\n\ntyped-ecstasy uses signals in the entitymanager, specifically:\n\n * onadd\n * onremove\n * onaddforfamily\n * onremoveforfamily\n\nthese will be emitted when an entity gets added/removed to/from the engine or a specific family.",
