    "headersStr": "About the Folder Structure",
    "content": "# Overview\n\nManually creating entities and components is tedious. Usually you want your entities to be created from your data. For a data-driven approach, you can use an EntityFactory. This way you can define blueprints for entities and load data from your levels automatically.\n\nThis guide shows one approach of doing this. The code should be flexible enough to allow you to adjust it to your project. If not, feel free to take a look at the source-code on GitHub and either create a ticket or create your own implementation.\n\nFollow these steps to get a data-driven approach:\n\n 1. Create components and respective factories to initialize said components\n 2. Adding some extra types (EntityConfig and Context)\n 3. Define blueprints (for example in .json format)\n 4. Set up an EntityFactory\n 5. Use the EntityFactory to create new entities\n\n\n# About the Folder Structure\n\nThe folder structure shown in this guide is just an example and you should adapt it as you see fit. You can find the source-code of this guide in the GitHub repository.",
    "normalizedContent": "# overview\n\nmanually creating entities and components is tedious. usually you want your entities to be created from your data. for a data-driven approach, you can use an entityfactory. this way you can define blueprints for entities and load data from your levels automatically.\n\nthis guide shows one approach of doing this. the code should be flexible enough to allow you to adjust it to your project. if not, feel free to take a look at the source-code on github and either create a ticket or create your own implementation.\n\nfollow these steps to get a data-driven approach:\n\n 1. create components and respective factories to initialize said components\n 2. adding some extra types (entityconfig and context)\n 3. define blueprints (for example in .json format)\n 4. set up an entityfactory\n 5. use the entityfactory to create new entities\n\n\n# about the folder structure\n\nthe folder structure shown in this guide is just an example and you should adapt it as you see fit. you can find the source-code of this guide in the github repository.",
    "charsets": {}
