    "headersStr": "src/blueprints/stoneBlueprint.ts src/blueprints/index.ts",
    "content": "# Defining Blueprints\n\nNow that we know how we can configure an entity, we can define entity blueprints for our entities. Depending on your use-case you could define them in TypeScript files (to have auto-completion and type-safety), store them as json files or get them in some other form. For simplicity, let's write them in a TypeScript file here.\n\nLet's create a folder src/blueprints and add these files to it:\n\n * stoneBlueprint.ts\n * .. additional files for more entities\n * index.ts\n\n\n# src/blueprints/stoneBlueprint.ts\n\nimport type { SampleEntityConfig } from \"../types\";\n\n// Here we define an entity blueprint, which contains 4 components and their default values\nexport const stoneBlueprint: SampleEntityConfig = {\n    Position: {\n        x: 10.1,\n        y: 11.2,\n    },\n    Sprite: {\n        image: \"stone.png\",\n        layer: 3,\n    },\n    Pickup: {\n        material: \"stone\",\n        amount: 4,\n    },\n    CameraFocus: {\n        weight: 42,\n    },\n};\n\n\nNow we can create a map, where the entity name is the key (by which we will later create the entity) and the blueprint is the value:\n\n\n# src/blueprints/index.ts\n\nimport type { SampleEntityConfig } from \"../types\";\nimport { stoneBlueprint } from \"./stoneBlueprint\";\n\n// This is a map of entity names to entity blueprints\nexport const blueprints: Record<string, SampleEntityConfig> = {\n    stone: stoneBlueprint,\n    // ... add more blueprints here\n};\n",
    "normalizedContent": "# defining blueprints\n\nnow that we know how we can configure an entity, we can define entity blueprints for our entities. depending on your use-case you could define them in typescript files (to have auto-completion and type-safety), store them as json files or get them in some other form. for simplicity, let's write them in a typescript file here.\n\nlet's create a folder src/blueprints and add these files to it:\n\n * stoneblueprint.ts\n * .. additional files for more entities\n * index.ts\n\n\n# src/blueprints/stoneblueprint.ts\n\nimport type { sampleentityconfig } from \"../types\";\n\n// here we define an entity blueprint, which contains 4 components and their default values\nexport const stoneblueprint: sampleentityconfig = {\n    position: {\n        x: 10.1,\n        y: 11.2,\n    },\n    sprite: {\n        image: \"stone.png\",\n        layer: 3,\n    },\n    pickup: {\n        material: \"stone\",\n        amount: 4,\n    },\n    camerafocus: {\n        weight: 42,\n    },\n};\n\n\nnow we can create a map, where the entity name is the key (by which we will later create the entity) and the blueprint is the value:\n\n\n# src/blueprints/index.ts\n\nimport type { sampleentityconfig } from \"../types\";\nimport { stoneblueprint } from \"./stoneblueprint\";\n\n// this is a map of entity names to entity blueprints\nexport const blueprints: record<string, sampleentityconfig> = {\n    stone: stoneblueprint,\n    // ... add more blueprints here\n};\n",
    "charsets": {}
